            mySweetAlert('', 'Room Name can not be blank', 'error', 400);
            $('#txtRoomName').focus();
            return false;
        }

        if (availableBookDay == '') 
        {
            mySweetAlert('', 'Available Book Day can not be blank', 'error', 400);
            $('#ddlAvailableBookDay').focus();
            return false;
        }
        else 
        {
  ");
