            return false;
        }

        if (availableTo == '') 
        {
            mySweetAlert('', 'Available To can not be blank', 'error', 400);
            $('#txtAvailableTo').focus();
            return false;
        }

        if (facilities == '') 
        {
            mySweetAlert('', 'Facilities can not be blank', 'error', 400);
